const ExpletusSansRegular = `@font-face { font-family: 'Expletus Sans'; font-style: normal; font-weight: 400; src: local('Expletus Sans'), local('ExpletusSans'), url('data:font/woff2;base64,') format('woff2'); }`;
const ExpletusSansItalic = `@font-face { font-family: 'Expletus Sans'; font-style: italic; font-weight: 400; src: local('Expletus Sans Italic'), local('ExpletusSans-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const ExpletusSans500 = `@font-face { font-family: 'Expletus Sans'; font-style: normal; font-weight: 500; src: local('Expletus Sans Medium'), local('ExpletusSans-Medium'), url('data:font/woff2;base64,') format('woff2'); }`;
const ExpletusSans500italic = `@font-face { font-family: 'Expletus Sans'; font-style: italic; font-weight: 500; src: local('Expletus Sans Medium Italic'), local('ExpletusSans-MediumItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
